def Manhattan_heuristic(a, b):
    # print("h score", abs(a[0] - a[1]) + abs(b[0]-b[1]))
    return abs(a[0] - b[0]) + abs(a[1] - b[1])

def Euclidean_heuristic(a, b):
    print(math.sqrt((a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2))
    return (math.sqrt((a[0] - b[0]) ** 2 + (a[1] - b[1]) ** 2))

def Chebyshev_heuristic(a, b):
    return max(abs(a[0] - b[0]), abs(a[1] - b[1]))

def dim_generator(dim, p):
    matrix = [[0 for i in range(dim)] for j in range(dim)]
    for i in range(dim):
        for j in range(dim):
            a = random.random()
            #  print(a)
            if (i == 0 and j == 0):
                continue
            if (i == dim - 1 and j == dim - 1):
                continue
            if (a < p):
                matrix[i][j] = 1  # 1 blocked
            else:
                matrix[i][j] = 0  # 0 open
    #print("matrix ", matrix)
    return matrix

def repeated_a_star(array, start, goal):
    open_set = []  # Heap structure we will use for the main loop
    neighbors = [(0, 1), (0, -1), (1, 0),
                 (-1, 0)]  # Only represent horizontal and vertical neighbors. Disregards diagonal neighbors
    close_set = []
    parents = {}
    gscores = {start: 0}
    fscores = {start: Manhattan_heuristic(start, goal)}

    # print("Manhattan_heuristic: ", Manhattan_heuristic(start,goal))
    # print("Euclidean Heuristic: ", Euclidean_heuristic(start,goal))
    # print("Chebyshev Heuristic: ", Chebyshev_heuristic(start,goal))

    heappush(open_set, (fscores[start], start))
    # print("open list ", open_set)
    # print()
    # counter = 0
    while open_set:
        # counter+=1

        # print("OPENLIST: ", open_set)
        # print(gscore)
        cheap = nsmallest(1000, open_set)
        # print("here ", cheap)
        highestgval = []




####BREAKING TIES START HERE
        # print(len(cheap))
        for k in range(len(cheap)):
            # print(cheap)
            #  print(k, "HERE")
            if (k >= len(cheap)):
                break

            if (cheap[k][0] > cheap[0][0]):
               #print("hello")
                #print(cheap[k][0], cheap[0][0], cheap[k])

                del cheap[k]
        # current = heappop(open_set)[1]
        # print("open_list2 ", cheap)
        # print(gscore)
        for i in range(len(cheap)):
            # print(cheap[i][0])
            # print(gscore[cheap[i][1]])
            if (not highestgval):
                #    print("First if added :", cheap[i][1])
                highestgval.append(cheap[i][1])
            ##### < means smaller g value######
            ##### > means higher g value#######
            if (gscores[cheap[i][1]] > gscores[highestgval[0]]):
                #       print("gscore listttt", gscore)
                #        print("comparison " , gscore[cheap[i][1]], gscore[highestgval[0]])
                del highestgval[0]
                #   print("smaller g value added " , cheap[i][1])
                highestgval.append(cheap[i][1])

        # print("higher g_val ", highestgval)
        # print(highestgval.pop(0))

        for spot in range(len(open_set)):
            if (open_set[spot][1] == highestgval[0]):
                #print("hereee", open_set[spot])
                current = open_set.pop(spot)[1]
                #current = current[1]
                #print("CURRENT", current)
                break
        # current = heappop(open_set)[1]
        # print("current " ,current)

        if current == goal:
            # print("end found")
            data = []
            # print(current)
            # print("came_From" ,came_from)
            while current in parents:
                #    print(current)
                data.append(current)
                current = parents[current]
            # del came_from[current]
            # print("shortest path exists")
            data.reverse()

            # print("counter:", counter)
            # print("close set length: " , len(close_set))
            print("Pathway for repeated a star algorithm: ")
            return data
        #

        # print("current: ", current, current[0], current[1])
        if (array[current[0]][current[1]] == 0):
            #     print(current, "inserted in closed_set")
            close_set.append(current)
        #    print("closed_set ", close_set)

        # close_set.add(current)
        for i, j in neighbors:

            # Obtain current's neighbor's cell.
            neighbor = current[0] + i, current[1] + j

            # We need this if statement to block out irrelevant cells produced by the neighbors protocol(initialized above)
            if (current[0] + i == -1 or current[1] + j == -1 or current[0] + i > goal[0] or current[1] + j > goal[0]):
                continue;
            if (array[neighbor[0]][[neighbor[1]]] == 1): #Blocked cell.
                continue
            temp_g_val = gscores[current] + Manhattan_heuristic(current, neighbor)

            if neighbor in close_set and temp_g_val >= gscores.get(neighbor,0):#no need to revisit
                continue
            # print(current, neighbor)
            # print("Manhattan Heuristic: ", Manhattan_heuristic(current, neighbor))
            # print("Euclidean Heuristic: ", Euclidean_heuristic(current,neighbor))
            # print("Chebyshev Heuristic: ", Chebyshev_heuristic(current,neighbor))
            # print("fvalue:", f_value, "neighbor:" , neighbor, "gvalue:", gscore.get(neighbor,0))
            # print("manhattan value: ", Manhattan_heuristic(current,neighbor))
            # print(current, "current")
            #  print(neighbor, "neighbor")


            #if the neighbor is not in open set we add the neighbor to the open set
            if temp_g_val < gscores.get(neighbor, 0) or neighbor not in [i[1] for i in open_set]:
                #print("toupdate ", current, neighbor)
                parents[neighbor] = current
                #     print("came_from list: " ,came_from)
                # print("neighbor : ", neighbor)
                gscores[neighbor] = temp_g_val
                #  print("list of gscores: " ,gscore)
                fscores[neighbor] = temp_g_val + Manhattan_heuristic(neighbor, goal)
                # print("list of fscores: ", fscore)
                heappush(open_set, (fscores[neighbor], neighbor))
                # print("Puhsed into heap: ", fscore[neighbor], "neighbor: ",neighbor)
    #  print()


    return "No shortest path"


def backward_astar(array, start, goal): #Switch start and goal. If given dimension 100x100, we start at (99,99) and our goal is (0,0).
    open_set = []
    neighbors = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    close_set = []

    came_from = {}
    gscores = {goal: 0}
    fscores = {goal: Manhattan_heuristic(goal, start)}
    heappush(open_set, (fscores[goal], goal))

    # print("open list ", open_set)
    # print()
    while open_set:
        # print("open_set ", open_set)
        cheap = nsmallest(1000, open_set)
        # print("here ", cheap)
        highestgval = []


    ###BREAKING TIES STARTS HERE
        # print(len(cheap))
        for k in range(len(cheap)):
            # print(cheap)
            #  print(k, "HERE")

            if (k >= len(cheap)):
                break
            # print(cheap[k][0], "here", k)
            if (cheap[k][0] > cheap[0][0]):
                del cheap[k]
        # current = heappop(open_set)[1]
        # print("open_list2 ", cheap)
        # print(gscore)
        for i in range(len(cheap)):
            # print(cheap[i][0])
            # print(gscore[cheap[i][1]])
            if (not highestgval):
                #    print("First if added :", cheap[i][1])
                highestgval.append(cheap[i][1])
            # < means smaller g value
            # > means higher g value
            if (gscores[cheap[i][1]] > gscores[highestgval[0]]):
                #       print("gscore listttt", gscore)
                #        print("comparison " , gscore[cheap[i][1]], gscore[highestgval[0]])
                del highestgval[0]
                #   print("smaller g value added " , cheap[i][1])
                highestgval.append(cheap[i][1])

        # print("higher g_val ", highestgval)
        # print(highestgval.pop(0))

        for spot in range(len(open_set)):
            if (open_set[spot][1] == highestgval[0]):
                #print("here", open_set[spot])
                current = open_set.pop(spot)[1]
                # current = current[1]
                #print("CURRENT", current)
                break
        # current = heappop(open_set)[1]
        # print("current ", current)

        if current == start:
            data = []
            #print(current)
            #print("came_From" ,came_from)
            while current in came_from:
                # print(current)
                data.append(current)
                current = came_from[current]
            # del came_from[current]

            # print("shortest path exists")
            # data.reverse()
            # print("Pathway for repeated backward a_star algorithm: ")
            return data

        if (array[current[0]][current[1]] == 0): #Hasn't been discovered
            # print(current, "closed_set current")
            close_set.append(current)
            #print("closedlist ", close_set)

        for i, j in neighbors:
            neighbor = current[0] + i, current[1] + j
            #   print("neighbour: ", neighbor)
            if (current[0] + i == -1 or current[1] + j == -1 or current[0] + i > start[0] or current[1] + j > start[0]):
                continue
            if (array[neighbor[0]][[neighbor[1]]] == 1):
                # print("true")
                continue
            temp_g_value = gscores[current] + Manhattan_heuristic(current, neighbor)
            # print("fvalue:", f_value, "neighbor:" , neighbor, "gvalue:", gscore.get(neighbor,0))
            if neighbor in close_set and temp_g_value >= gscores.get(neighbor, 0):
                continue
            if temp_g_value < gscores.get(neighbor, 0) or neighbor not in [i[1] for i in open_set]:
                came_from[neighbor] = current
                gscores[neighbor] = temp_g_value
                # print("list of gscores: " ,gscore)
                fscores[neighbor] = temp_g_value + Manhattan_heuristic(neighbor, start)
                #  print("list of fscores: ", fscore)
                heappush(open_set, (fscores[neighbor], neighbor))
    #  print()

    # print()

    return "No shortest path"


